function test3({posts}){
    return(
        <ul>
            {posts.map((post)=>(
                <li>{post.title}</li>
            ))}
        </ul>
    );
}

export async function getStaticProps(){
    const res=await fetch("http://localhost:3000//posts")
    const posts=await res.json()
    return{
        props:{
            posts,
        }
    }
}
export default test3
